import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div class="container-main">
        <div class="section-content">
          <h3 id="homePage">
            BUY
            BORROW
            BURN
          </h3>
        </div>
      </div>
    );
  }
}

export default Home;
